summary:
Jomec is an investment banking service firm specialised in China related M&A transactions. It is a partner of Clairfield International. It also acts on behalf of Chinese investors to make and manage their investments outside China. 

Specialties: 
China Business Strategy, and M&A Strategy;
Lead through the whole M&A process, from identifying target seller or buyer to valuation as well as closing deals;
Investment and investment management;
Legal and business consulting services.
